const Title = () => {
  return (
      <div className="p-mainvisual_insp_textbox">
        <h2 className="p-mainvisual_insp_title u-text-navy2">肛門外科</h2>
        <p className="p-mainvisual_insp_text u-text-navy2" style={{textShadow: '1px'}}>
          年間<span className="u-text-pink2">1,200</span>件の手術実績
        </p>
        <a href="https://hachicli.or.jp/hemo/2023yomiuri.pdf"><img src="./resources/img/hemo2/byouinno.png" alt="" /></a>
      </div>
  );
};

export default Title;
